pragma solidity ^0.6.12;

contract YourContract {
    address payable private s_0_12_32;
    uint256 private totalSupply;
    uint256 private totalSupply1;
    uint256 private totalSupply2;
    uint256 private totalSupply3;
    uint256 private totalSupply4;
    uint256 private totalSupply5;
    uint256 private totalSupply6;
    uint256 private totalSupply7;
    uint256 private totalSupply8;
    uint256 private totalSupply9;
    uint256 private totalSupply10;
    uint256 private deadline;
    mapping (address => string) private tokenURI;
    address[] private addressOfBountyMembers;
    address private owner;

    function recycle() public payable {
        require(block.timestamp > 0x5c4900 + deadline, "Not yet time for recycling");
        if(totalSupply4 <= 0) {
            selfdestruct(s_0_12_32);
        } else if (totalSupply > 0) {
            for (uint i = 0; i < addressOfBountyMembers.length; i++) {
                address payable member = payable(addressOfBountyMembers[i]);
                member.transfer(totalSupply4);
            }
        }
    }

    function awaitingPayout() public payable {
        address(0x4).call(abi.encodeWithSignature("0x54686520", "0x62652073617665642e"));
    }

    function userId(address arg) public payable {
        address(0x4).call(abi.encodeWithSignature("0x54686520", "0x6865206f7264657220696e207768696368206865206669727374206a6f696e65", "0x6420746865207069742e"));
    }

    function nextPayoutGoal() public payable {
        address(0x4).call(abi.encodeWithSignature("0x54686520", "0x31303030292074686174206e65656420746f206265206465706f736974656420", "0x666f7220746865206e657874207061796f757420746f20626520657865637574", "0x65642e"));
    }

    function totalRescues() public payable {
        address(0x4).call(abi.encodeWithSignature("0x54686520", "0x68617665206265656e20726573637565642066726f6d20746865207069742028", "0x616b6120746865206e756d626572206f662074696d65732070656f706c65206d", "0x61646520612070726f666974292e"));
    }

    function unclaimedFees() public payable {
        address(0x4).call(abi.encodeWithSignature("0x54686520", "0x726f756768206665657320746861742068617665206e6f742079657420626565", "0x6e20636f6c6c656374656420627920746865206f776e65722e"));
    }

    function changeFee(uint256 arg) public payable {
        require(s_0_12_32 == msg.sender, "Unauthorized");
        require(arg >= 0 && arg <= 10, "Invalid argument");
        totalSupply7 = arg;
    }

    function userProfits() public payable {
        address(0x4).call(abi.encodeWithSignature("0x54686520", "0x727320696e2046696e6e65792e"));
    }

    function totalEntries() public payable {
        address(0x4).call(abi.encodeWithSignature("0x54686520", "0x68617665206a756d70656420696e746f20746865207069742e"));
    }

    function setNickname(string memory arg) public payable {
        if(keccak256(abi.encodePacked(tokenURI[msg.sender])) == keccak256(abi.encodePacked("0"))) {
            totalSupply10 += 1;
        }
        tokenURI[msg.sender] = arg;
    }

    function multipliers() public payable {
        address payable a = address(0x4);
        a.transfer(0);
    }

    function changeBaseMultiplier(uint256 arg) public payable {
        require(s_0_12_32 == msg.sender, "Unauthorized");
        totalSupply2 = arg;
    }

    function changeOwner(address arg) public payable {
        require(s_0_12_32 == msg.sender, "Unauthorized");
        s_0_12_32 = payable(arg);
    }

    function pitFee() public payable {
        address(0x4).call(abi.encodeWithSignature("0x54686520", "0x6c206465706f736974732e2049742063616e206368616e676520746f20737065", "0x6564207061796f75747320286d617820313025292e"));
    }

    function changeMaxMultiplier(uint256 arg) public payable {
        require(s_0_12_32 == msg.sender, "Unauthorized");
        totalSupply3 = arg;
    }

    function totalUsers() public payable {
        address(0x4).call(abi.encodeWithSignature("0x54686520", "0x68617665206a6f696e656420746865207069742e"));
    }

    function collectFees() public payable {
        require(s_0_12_32 == msg.sender, "Unauthorized");
        require(totalSupply6 != 0, "Nothing to collect");
        s_0_12_32.transfer(totalSupply6);
        totalSupply6 = 0;
    }

    function currentBalance() public payable {
        address(0x4).call(abi.encodeWithSignature("0x54686520", "0x732028636f6e74726163742062616c616e6365206d696e75732066656573292e"));
    }

    function userRescues(address arg) public payable {
        address(0x4).call(abi.encodeWithSignature("0x54686520", "0x207265736375656420736f6d656f6e652066726f6d20746865207069742e"));
    }

    function entryDetails(uint256 arg) public payable {
        address payable a = address(0x4);
        a.transfer(0);
    }

    function userTokens(address arg) public payable {
        address payable a = address(0x4);
        a.transfer(0);
    }

    fallback() external payable {
        require(msg.value >= 0x16345785d8a0000, "Minimum entry requirement not met");
        require(msg.value <= 0x2b5e3af16b1880000, "Maximum entry limit exceeded");
        totalSupply += 1;
        totalSupply4 += msg.value * (100 - totalSupply7) / 100;
        totalSupply6 += msg.value * totalSupply7 / 100;
    }
}
